import { Navigate, Route } from 'react-router-dom';
import Demographic from './Demographic';

function App() {
  return (
    <div>
      <Route exact path="/" element={<Navigate to="/demographic" />} />
      <Route path="/demographic" element={<Demographic />} />
    </div>
  );
}

export default App;
